import React, { Component } from 'react';
import { fetchDetailAvail as fetch } from '../../Fetches/Fetches';

class WantedList extends Component {
  fetch = async () => {
    console.log(await fetch());
  };
  componentDidMount() {
    this.fetch();
  }
  render() {
    return <div>HI</div>;
  }
}

export default WantedList;
